script: |
  super -f text -I q10759.spq | sort > q10759.out

inputs:
  - name: q10759.spq
    data: |
      SELECT - col1 + + - 73 AS col0 FROM tab2 (FORMAT parquet) WHERE + col1 + - ( col0 ) - - 79 / - col1 NOT IN ( + col0, 21, + 25 * col0 );
  - name: tab2

outputs:
  - name: q10759.out
    data: |
      -124
      -140
      -150
